export default class Footer extends Component {
  render() {
    return (
      <div className='d-flex justify-content-center py-5 mt-5'>
        <i class='fas fa-code'></i> with <i class='fas fa-heart'></i>{" "}
        <a href='https://www.pakkamarwadi.tk/' target='_blank'>
          Pakkamarwadi
        </a>
      </div>
    );
  }
}
